import React  from 'react';

const Pirate = (props) => {

  if(!props.pirate){
    return "Loading..."
  }


  return (
    <Fragment>
      <p>{props.pirate.firstName} {props.pirate.lastName}</p>
    </Fragment>
  )
}

export default Pirate;
